  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains well log observations
  compiled by the Hawaii Geological Survey, and published as a Web feature service
  for the National Geothermal Data System. Fields in the Well Log Observation Content
  Model will become XML elements in interchange documents for WMS simple features
  provided by a node in the USGIN network. Each feature includes a well type, status
  date, log file location, logged interval and source. The dataset is spatially referenced
  to EPSG: 4326 (for interoperability). The data contained in the submitted dataset
  is available as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to
  Well Log Observation Content Model: http://www.stategeothermaldata.org/data_delivery/content_models/well_log_observation.\",\n\t\"license_title\":
